import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <div class="ui secondary pointing menu">
    <Link to='/'>
      <a class="item">Home</a>
    </Link>
    <Link to='/teams'>
      <a class="item">Teams</a>
    </Link>
    <Link to='/players'>
      <a class="item">Players</a>
    </Link>
  </div>
);

export default Header;
